function BarList() {

    const bars = [

        {name : "L'Industrie Café Comptoir", adress : "10 Pl. Ambroise Courtois, 69008 Lyon", priceLevel : "€€"}

    ];

    return (
        <div>
            {bars.map((bar, index) => (

                <div key={index}>
                    <h3>{bar.name}</h3>
                    <p>{bar.adress}</p>
                    <p>{bar.priceLevel}</p>

                </div>         
            ))};
        </div>

    )
}

export default BarList
